const searchChildrenForKey = (aKey, anArray) => {
  for (let i = 0; i < anArray.length; i += 1) {
    if (anArray[i].key === aKey) {
      return anArray[i];
    }
  }
  return null;
};

// builds the structure
export const buildTree = (data) => {
  const newData = {
    key: 'root',
    children: [],
  };
  for (let d of data.children) {
    let curParent = newData;
    let newParent = null;
    const pathArray = d.Page.split('/').slice(1);
    for (let i = 0; i < pathArray.length; i += 1) {
      newParent = searchChildrenForKey(pathArray.slice(0, i+1).join('/'), curParent.children);
      if (!newParent) {
        curParent.children.push(
          {
            key: pathArray.slice(0, i+1).join('/'),
            pageViews: i == pathArray.length - 1 ? parseInt(d.Pageviews.replace(/,/g,''), 10) : 0,
            fullPath: d.Page,
            children: [],
          }
        );
        curParent = curParent.children[curParent.children.length - 1];
      } else {
        curParent = newParent;
      }
    }
  }
  return newData;
};